full_text:
I led my colleagues in condemning @DHSgov for its continued war on legal immigrants.

@USCIS has raised fees for legal immigrants 41% since 2016 &amp; @DHS_Wolf just created a new fee for asylum-seekers while eliminating low-income fee waivers.

This rule must be rescinded! https://t.co/QsEMWq1Qur

Presidential pardons are intended to give clemency and compassion, not to excuse partisan political crimes. 

@HouseJudiciary voted to pass HR 7695, the Abuse of Power Prevention Act to ensure no president can commit a crime and pardon themselves.

No one is above the law!

@mle_anne_ @WellsFargo @SBAgov Call the @OCIESBDC at 1-800-616-7232. 

They will help you figure out what resources are right for your business &amp; how you can apply. 

You can find more information on my website 👉🏽 https://t.co/RTdGXehDO7

We cannot forget our DREAMers! 

I sent a letter to @SpeakerPelosi requesting that #DREAMers be part of any deal.

@RepCarbajal
@RepEspaillat 
@RepDarrenSoto 
@RepCardenas 
@RepJuanVargas 
@RepChuyGarcia https://t.co/Len6chPajN

